import React, { Component } from "react";
import CustomHeader from "./Components/CustomHeader/CustomHeader";
import MainContent from "./Components/MainContent/MainContent";
import "./App.css";

class App extends Component {
  constructor(props) {
    super(props);

    this.state = {
      todoItems: [
        { name: "Clean", completed: false },
        { name: "Bath", completed: false },
        { name: "Go Out", completed: false }
      ]
    };
  }
  render() {
    const todoItems = this.state.todoItems.map(item => {
      return (
        <li
          style={{
            textDecoration: item.completed === false ? "none" : "lineTrough"
          }}
        >
          {item.name}
        </li>
      );
    });

    return (
      <div className="App">
        <CustomHeader />
        <MainContent />
        <ul>{todoItems}</ul>
      </div>
    );
  }
}

export default App;
